const clockGroup = document.getElementById("clock");
const centerX = 100; // X-Koordinate des Uhrenmittelpunkts
const centerY = 100; // Y-Koordinate des Uhrenmittelpunkts

function updateClock() {
  const now = new Date();
  const hours = now.getHours();
  const minutes = now.getMinutes();
  const seconds = now.getSeconds();

  const hourAngle = (hours % 12 + minutes / 60) * 30;
  const minuteAngle = (minutes + seconds / 60) * 6;
  const secondAngle = seconds * 6;

  document.getElementById("hour").setAttribute("transform", `rotate(${hourAngle})`);
  document.getElementById("minute").setAttribute("transform", `rotate(${minuteAngle})`);
  document.getElementById("second").setAttribute("transform", `rotate(${secondAngle})`);

  requestAnimationFrame(updateClock);
}

updateClock();
